function Home() {
    return (
    <div className="welcome">
        <h1 className="well">Добро пожаловать!</h1>
        <p className="well">
        Суфиярова Людмила Викторовна -
учитель  географии, заместитель директора по воспитательной работе.
Категория - педагог-эксперт.
        </p>
        <img src="https://i.ibb.co/KwV041J/IMG-20220213-135300.jpg" alt="" className="home-img" />
    </div>
    );
}

export default Home
